import React, { useState } from "react";
import {
  Button,
  LinearProgress,
  Card,
  CardContent,
  Typography,
  TextField,
  Grid,
  Box
} from "@material-ui/core";

const totalSteps = 11;

const PlanFinder = () => {
  const [step, setStep] = useState(1);
  const [answers, setAnswers] = useState({});
  const [leadInfo, setLeadInfo] = useState({
    name: "",
    email: "",
    company: "",
  });

  const nextStep = () => setStep(prev => prev + 1);
  const prevStep = () => setStep(prev => prev - 1);

  const handleAnswer = (key, value) => {
    setAnswers(prev => ({ ...prev, [key]: value }));
  };

  const handleMultiSelect = (key, value) => {
    setAnswers(prev => {
      const existing = prev[key] || [];
      if (existing.includes(value)) {
        return { ...prev, [key]: existing.filter(v => v !== value) };
      }
      return { ...prev, [key]: [...existing, value] };
    });
  };

  const handleLeadChange = (e) => {
    setLeadInfo({ ...leadInfo, [e.target.name]: e.target.value });
  };

  const isStepValid = () => {
    switch (step) {
      case 1: return answers.employeeCount !== undefined;
      case 4: return answers.workerTypes && answers.workerTypes.length > 0;
      case 11: return leadInfo.name && leadInfo.email && leadInfo.company;
      default: return true;
    }
  };

  const calculateScore = () => {
    let total = 0;
    Object.keys(answers).forEach(key => {
      if (Array.isArray(answers[key])) {
        total += answers[key].reduce((a, b) => a + b, 0);
      } else {
        total += answers[key];
      }
    });
    if (answers.workerTypes && answers.workerTypes.length >= 3) {
      total += 2;
    }
    return total;
  };

  const getRecommendation = (score) => {
    if (score <= 10) return { name: "Starter", price: "2,000 PHP" };
    if (score <= 20) return { name: "Professional", price: "6,000 PHP" };
    return { name: "Enterprise", price: "13,000 PHP" };
  };

  const progress = (step / totalSteps) * 100;

  const OptionButton = ({ selected, onClick, children }) => (
    <Button
      fullWidth
      onClick={onClick}
      style={{
        marginBottom: 15,
        padding: "14px",
        borderRadius: 14,
        textTransform: "none",
        fontWeight: 500,
        fontSize: 16,
        backgroundColor: selected ? "#FF7504" : "#f4f6f8",
        color: selected ? "#fff" : "#333",
        boxShadow: selected
          ? "0 10px 25px rgba(255,117,4,0.35)"
          : "none",
        transition: "all 0.25s ease",
      }}
    >
      {children}
    </Button>
  );

  const renderStep = () => {
    switch (step) {

      case 1:
        return (
          <>
            <Typography variant="h6" style={{ marginBottom: 20 }}>
              How many employees do you have?
            </Typography>
            <OptionButton selected={answers.employeeCount === 1} onClick={() => handleAnswer("employeeCount", 1)}>1-20</OptionButton>
            <OptionButton selected={answers.employeeCount === 2} onClick={() => handleAnswer("employeeCount", 2)}>21-50</OptionButton>
            <OptionButton selected={answers.employeeCount === 3} onClick={() => handleAnswer("employeeCount", 3)}>50-150</OptionButton>
            <OptionButton selected={answers.employeeCount === 4} onClick={() => handleAnswer("employeeCount", 4)}>151+</OptionButton>
          </>
        );

      case 4:
        return (
          <>
            <Typography variant="h6" style={{ marginBottom: 20 }}>
              What types of workers do you pay?
            </Typography>
            {[
              { label: "Fixed", value: 1 },
              { label: "Daily", value: 2 },
              { label: "Project", value: 2 },
              { label: "Field", value: 3 },
              { label: "Mixed", value: 3 },
            ].map((item, index) => (
              <OptionButton
                key={index}
                selected={answers.workerTypes?.includes(item.value)}
                onClick={() => handleMultiSelect("workerTypes", item.value)}
              >
                {item.label}
              </OptionButton>
            ))}
          </>
        );

      case 10:
        const score = calculateScore();
        const recommendation = getRecommendation(score);

        return (
          <Box textAlign="center" py={3}>
            <Typography variant="h5" style={{ fontWeight: 600 }}>
              ðŸŽ‰ Your Recommended Plan
            </Typography>

            <Typography
              variant="h3"
              style={{
                marginTop: 20,
                fontWeight: 700,
                color: "#FF7504"
              }}
            >
              {recommendation.name}
            </Typography>

            <Typography variant="h6" style={{ marginTop: 10 }}>
              {recommendation.price} / month
            </Typography>

            <Button
              variant="contained"
              color="primary"
              style={{
                marginTop: 30,
                borderRadius: 30,
                padding: "10px 30px",
                boxShadow: "0 10px 30px rgba(255,117,4,0.4)"
              }}
              onClick={() => setStep(11)}
            >
              Avail This Plan
            </Button>
          </Box>
        );

      case 11:
        return (
          <>
            <Typography variant="h6" style={{ marginBottom: 20 }}>
              Enter Your Details
            </Typography>

            <TextField
              label="Full Name"
              name="name"
              value={leadInfo.name}
              onChange={handleLeadChange}
              fullWidth
              margin="normal"
              variant="outlined"
            />
            <TextField
              label="Email"
              name="email"
              value={leadInfo.email}
              onChange={handleLeadChange}
              fullWidth
              margin="normal"
              variant="outlined"
            />
            <TextField
              label="Company"
              name="company"
              value={leadInfo.company}
              onChange={handleLeadChange}
              fullWidth
              margin="normal"
              variant="outlined"
            />

            <Button
              variant="contained"
              color="primary"
              disabled={!isStepValid()}
              style={{
                marginTop: 20,
                borderRadius: 30,
                padding: "10px 30px"
              }}
            >
              Submit Inquiry
            </Button>
          </>
        );

      default:
        return <Typography>Continue answering the questions...</Typography>;
    }
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        background: "linear-gradient(135deg, #FF7504 0%, #ff9a3c 100%)",
        padding: "2rem"
      }}
    >
      <Card
        style={{
          width: 700,
          padding: 40,
          borderRadius: 20,
          boxShadow: "0 25px 70px rgba(0,0,0,0.2)",
          backgroundColor: "#ffffff"
        }}
      >
        <CardContent>

          <Typography
            variant="h4"
            gutterBottom
            style={{ fontWeight: 600 }}
          >
            UlapPayroll Plan Finder
          </Typography>

          <LinearProgress
            variant="determinate"
            value={progress}
            style={{
              height: 8,
              borderRadius: 10,
              marginBottom: 8
            }}
          />

          <Typography variant="caption">
            Step {step} of {totalSteps}
          </Typography>

          <div style={{ marginTop: 30 }}>
            {renderStep()}
          </div>

          {step < 10 && (
            <Grid container spacing={2} style={{ marginTop: 30 }}>
              {step > 1 && (
                <Grid item>
                  <Button
                    variant="outlined"
                    onClick={prevStep}
                    style={{ borderRadius: 30 }}
                  >
                    Back
                  </Button>
                </Grid>
              )}
              <Grid item>
                <Button
                  variant="contained"
                  color="primary"
                  onClick={nextStep}
                  disabled={!isStepValid()}
                  style={{
                    borderRadius: 30,
                    boxShadow: "0 8px 20px rgba(255,117,4,0.4)"
                  }}
                >
                  Next â†’
                </Button>
              </Grid>
            </Grid>
          )}

        </CardContent>
      </Card>
    </div>
  );
};

export default PlanFinder;
